import "contador.css"
import { useState } from "react"

export default function Contador(props){
   const [contador, setContador] = useState(props.numero);

   const buttonClick = () => {
    setContador(contador + 1)
   }
  return (
    <>
    <button onClick={buttonClick}>Cont</button>
    </>
  )

}
